import PopupWithForm from "./PopupWithForm"

const InfoTooltip = (props) => {

	const handleSubmit = (e) => {
		e.preventDefault()
	}

	console.log(props)
	return (
		<PopupWithForm
			isOpen={props.isOpen}
			onClose={props.onClose}
			onSubmit={handleSubmit}
			name='infoTooltip'
			title='Вы успешно зарегистрировались!'
			icon=""
		>
			ну хуй
		</PopupWithForm>
	)
}

export default InfoTooltip
